import "./hero_style.css";



export default function Hero(props){
    return(
        <div className={p}>
            <img alt="HerpImage" src="https://images.pexels.com/photos/1024967/pexels-photo-1024967.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"/>
        </div>
    );
}
